import React from 'react';
import AppLayout from '../components/AppLayout';
import NicknameEditForm from '../components/NicknameEditForm';
import FollowerList from '../components/FollowerList';
import FollowList from '../components/FollowList';
import Head from 'next/head';

const Profile=()=>{
    const followerList = [{nickname:'제로초'},{nickname:'WooSeok_The_Emperor'},{nickname:'노드버드오피셜'}];
    const followingList = [{nickname:'제로초'},{nickname:'WooSeok_The_Emperor'},{nickname:'노드버드오피셜'}];
    return (
        <>
            <Head>
                <title>내프로필 | NodeBird</title>
            </Head>
            <AppLayout>
                <NicknameEditForm/>
                <FollowList header="팔로잉 목록" data={followingList}/>
                <FollowerList header="팔로워 목록" data={followerList}/>

            </AppLayout>
        </>
    )
}

export default Profile;
